import './Phone.css';
import React from 'react'

const Phone = () => {
  return (
    <div className='phone-container'>
        <div className='phone-border'>
            <div className='phone-homeButton'>
                <div className='phone-frontCamera'>
                    <div className='phone-speaker'></div>
                </div>
            </div>
        </div>
    </div>
  )
}

export default Phone
